import React, { Component } from 'react';
import DefaultImage from '../../../../images/default_user.png';

class UserInformation extends Component {
    render() {
        const address = this.props.user.address;
        const picture = this.props.user.picture ? 
            <img src={this.props.user.picture} width="100" height="100" className="rounded-circle" /> : 
            <img src={DefaultImage} width="100" height="30" className="rounded-circle" />;
        return (
            <div>
                <div className="row p-5">
                    <div className="col-md-4">
                        <div className="row">
                            {picture}
                        </div>
                        <div className="row">
                            <div className="col">
                                <h6 className="text-muted">{this.props.user.firstName} {this.props.user.lastName}</h6>
                                <hr></hr>
                                <p>{address}</p>
                                <p>{this.props.user.email}</p>
                                <p>{this.props.user.phone}</p>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-8">

                    </div>

                </div>
            </div>
        );
    }
}

export default UserInformation;
